	function init_image_zoom() {
		//Dropdown zoom level clicked
		jQuery(document).on('click', '.dropdown-zoom .dropdown-menu li a', function (ev) {
			ev.preventDefault();
			var value = jQuery(this).text();
			var div_obj = jQuery(this).closest(".dropdown-zoom").parent().find(".tile");
			var button_obj = jQuery(this).closest(".dropdown-zoom").find("button");
			var mag_level = "1x";
			if (value === '1x'){
				div_obj.attr('data-scale', '1');
				button_obj.html('1x&nbsp;<span style="vertical-align: text-bottom">' + _config.caret_svg + '</span>');
			} else if (value === '2x'){
				div_obj.attr('data-scale', '2');
				button_obj.html('2x&nbsp;<span style="vertical-align: text-bottom">' + _config.caret_svg + '</span>');
				mag_level = "2x"
			} else if (value === '3x'){
				div_obj.attr('data-scale', '3');
				button_obj.html('3x&nbsp;<span style="vertical-align: text-bottom">' + _config.caret_svg + '</span>');
				mag_level = "3x"
			} else if (value === '6x'){
				div_obj.attr('data-scale', '6');
				button_obj.html('6x&nbsp;<span style="vertical-align: text-bottom">' + _config.caret_svg + '</span>');
				mag_level = "6x"
			}
			var paper_id = div_obj.parent().attr('pid');
			var desc =  'Image Magnification Click';
			var descx = _config.vendor + ':' + desc;
			badge_event("Badge Click", desc, _config.vendor, paper_id, mag_level);
			if (self.mini_flag != "m" && self.mini_flag != "s") {
				// ga('send', 'event', 'Vendor Widget', descx, mag_level);
			}
		});
		jQuery('.tile')
			// tile mouse actions
			.on('mouseover', function(){
				jQuery(this).children('.photo').css({'transform': 'scale('+ jQuery(this).attr('data-scale') +')'});
				if (jQuery(this).attr('data-scale') > 1) {
					jQuery(this).css({'border': 'solid 1px #ccc'});
				}
			})
			.on('mouseout', function(){
				jQuery(this).children('.photo').css({'transform': 'scale(1)'});
				if (jQuery(this).attr('data-scale') > 1) {
					jQuery(this).css({'border': 'none'});
				}
			})
			.on('mousemove', function(e){
				jQuery(this).children('.photo').css({'transform-origin': ((e.pageX - jQuery(this).offset().left) / jQuery(this).width()) * 100 + '% ' + ((e.pageY - jQuery(this).offset().top) / jQuery(this).height()) * 100 +'%'});
			})
			// tiles set up
			.each(function(){
				jQuery(this)
					// set up a background image for each tile based on data-image attribute
					.children('.photo').css({'background-image': 'url('+ jQuery(this).attr('data-image') +')'});
			});
	}

