	function w_toggle_more_less(event, a_id, excerpt_id, paper_id) {
		event.preventDefault();
		if (excerpt_id.indexOf("short") > 0) {
			jQuery(excerpt_id).hide("slow");
			excerpt_id = excerpt_id.replace("short", "long");
			jQuery(excerpt_id).show("slow").css('display', '');
			if (jQuery(a_id)[0]) {
				if (a_id.indexOf("magnify") > -1) {
					jQuery(a_id).hide();
					a_id = a_id.replace("magnify", "caption");
				} else if (a_id.indexOf("caption") > -1) {
					var x_id = a_id.replace("caption", "magnify");
					jQuery(x_id).hide();
				}
				jQuery(a_id).html(self.lang.i18l("less"));
				jQuery(a_id).attr("idx", jQuery(a_id).attr("idx").replace("short", "long"));
				jQuery(a_id + "-ret").css('display', '');
			}
			var parts = excerpt_id.split('-');
			var main_id = parts.pop();
			while (parts.length > 3) {
				main_id = parts.pop() + "-" + main_id;
			}
			var parent_main_id = main_id.substr(0, stringLastIndexOf(main_id, "-") - 1);
			adjust_height_to_table(600, parent_main_id);

			var desc = 'More-Less Excerpt Click';
			var descx = _config.vendor + ':' + desc;
			badge_event("Badge Click", desc, _config.vendor, self.query, paper_id);
			// ga('send', 'event', 'Vendor Widget', descx, "Query: " + self.query);
		} else {
			jQuery(excerpt_id).hide("slow");
			excerpt_id = excerpt_id.replace("long", "short");
			jQuery(excerpt_id).show("slow").css('display', '');
			if (jQuery(a_id)[0]) {
				if (a_id.indexOf("caption") > -1) {
					var x_id = a_id.replace("caption", "magnify");
					jQuery(x_id).show();
				}
				jQuery(a_id).html(self.lang.i18l("more"));
				jQuery(a_id).attr("idx", jQuery(a_id).attr("idx").replace("long", "short"));
				jQuery(a_id + "-ret").css('display', 'none');
			}
			var parts = excerpt_id.split('-');
			var main_id = parts.pop();
			while (parts.length > 3) {
				main_id = parts.pop() + "-" + main_id;
			}
			var parent_main_id = main_id.substr(0, stringLastIndexOf(main_id, "-") - 1);
			adjust_height_to_table(600, parent_main_id);

			var desc = 'More-Less Excerpt Click';
			var descx = _config.vendor + ':' + desc;
			badge_event("Badge Click", desc, _config.vendor, self.query, paper_id);
			// ga('send', 'event', 'Vendor Widget', descx, "Query: " + self.query);
		}
	}

