	function stringLastIndexOf(str, c) {
		var pos = str.split("").reverse().join("").indexOf(c);
		return pos == -1 ? -1 : str.length - pos;
	}
	function get_slides(main_id) {
		var slides = 1;
		jQuery(".bioz-w-slide").each(function() {
			if (jQuery(this).prop('id').indexOf(main_id + "-") > 0) {
				slides++;
			}
		});
		return slides - 1;
	}
	function get_slide_index_from_main_id(main_id) {
		return main_id.substr(stringLastIndexOf(main_id, "-"), main_id.length);
	}
	function next(ev, main_id) {
		var current_slide_index = get_slide_index_from_main_id(main_id);
		_current_slides[current_slide_index]++;
		_max_slide = get_slides(main_id);
		if (_current_slides[current_slide_index] > _max_slide) {
			_current_slides[current_slide_index] = _max_slide;
		}
		enable_disable_arrows(main_id);
		// location.href = "#bioz-w-slide-" + _current_slides[current_slide_index];
		var myElement = jQuery("#bioz-w-slide-" + main_id + "-" + _current_slides[current_slide_index])[0];
		var leftPos = myElement.offsetLeft;
		jQuery("#bioz-w-record-slider-" + main_id)[0].scrollLeft = leftPos;
		var desc =  'Carousel Next-Prev Click';
		var descx = _config.vendor + ':' + desc;
		badge_event("Badge Click", desc, _config.vendor, self.query, "Next");
		if (self.mini_flag != "m" && self.mini_flag != "s") {
			// ga('send', 'event', 'Vendor Widget', descx, "Next");
		}
	}
	function prev(ev, main_id) {
		var current_slide_index = get_slide_index_from_main_id(main_id);
		_current_slides[current_slide_index]--;
		if (_current_slides[current_slide_index] < 1) {
			_current_slides[current_slide_index] = 1;
		}
		enable_disable_arrows(main_id);
		// location.href = "#bioz-w-slide-" + _current_slides[current_slide_index];
		var myElement = jQuery("#bioz-w-slide-" + main_id + "-" + _current_slides[current_slide_index])[0];
		var leftPos = myElement.offsetLeft;
		jQuery("#bioz-w-record-slider-" + main_id)[0].scrollLeft = leftPos;
		var desc =  'Carousel Next-Prev Click';
		var descx = _config.vendor + ':' + desc;
		badge_event("Badge Click", desc, _config.vendor, self.query, "Prev");
		if (self.mini_flag != "m" && self.mini_flag != "s") {
			// ga('send', 'event', 'Vendor Widget', descx, "Prev");
		}
	}
	function enable_disable_arrows(main_id) {
		var current_slide_index = get_slide_index_from_main_id(main_id);
		_max_slide = get_slides(main_id);
		if (_current_slides[current_slide_index] == _max_slide) {
			jQuery("#bioz-w-next-link-" + main_id).hide();
			if (_max_slide > 1) {
				jQuery("#bioz-w-prev-link-" + main_id).show();
			} else {
				jQuery("#bioz-w-prev-link-" + main_id).hide();
			}
		} else if (_current_slides[current_slide_index] == 1) {
			jQuery("#bioz-w-next-link-" + main_id).show();
			jQuery("#bioz-w-prev-link-" + main_id).hide();
		} else {
			jQuery("#bioz-w-next-link-" + main_id).show();
			jQuery("#bioz-w-prev-link-" + main_id).show();
		}
	}
	function count_images(records, record_count) {
		var image_count = 0;
		for (var i = 0; i < record_count; i++) {
			var record = records[i];
			if (record.image_urls) {
				for (var j = 0; j < record.image_urls.length; j++) {
					image_count++;
				}
			}
		}
		return image_count;
	}
