	function processCSVRow(row) {
		var finalVal = '';
		for (var j = 0; j < row.length; j++) {
			var innerValue = (typeof(row[j]) == 'undefined' || row[j] === null ? '' : row[j].toString());
			if (row[j] instanceof Date) {
				innerValue = row[j].toLocaleString();
			};
			var result = innerValue.replace(/"/g, '""');
			if (result.search(/("|,|\n)/g) >= 0)
				result = '"' + result + '"';
			if (j > 0)
				finalVal += ',';
			finalVal += result;
		}
		return finalVal + '\n';
	}
	function exportToCSV(filename, rows) {
		var csvFile = '';
		for (var i = 0; i < rows.length; i++) {
			csvFile += processCSVRow(rows[i]);
		}

		var blob = new Blob([csvFile], { type: 'text/csv;charset=utf-8;' });
		if (navigator.msSaveBlob) { // IE 10+
			navigator.msSaveBlob(blob, filename);
		} else {
			var link = document.createElement("a");
			if (link.download !== undefined) { // feature detection
				// Browsers that support HTML5 download attribute
				var url = URL.createObjectURL(blob);
				link.setAttribute("href", url);
				link.setAttribute("download", filename);
				link.style.visibility = 'hidden';
				document.body.appendChild(link);
				link.click();
				document.body.removeChild(link);
			}
		}
	}
	function convert_to_pre_csv(data, headers) {
		var return_data = [];
		var header_row = [];
		var prevent_score = false;
		if (typeof(_no_score_in_export) != 'undefined' && _no_score_in_export == "1") {
			prevent_score = true;
		}
		for (var i = 0; i < headers.length; i++) {
			if (!prevent_score || headers[i].toLowerCase() != "score") {
				header_row.push(headers[i]);
			}
		}
		return_data.push(header_row);
		for (var i = 0; i < data.length; i++) {
			var return_row = [];
			for (var j = 0; j < self.export_columns.length; j++) {
				var index_name = self.export_columns[j];
				if (index_name == 'epoch_time') {
					// convert to date ...
					var pub_date = new Date(data[i][index_name] * 1000);
					return_row.push(pub_date);
				} else if (!prevent_score || index_name.toLowerCase() != "score") {
					return_row.push(data[i][index_name]);
				}
			}
			return_data.push(return_row);
		}
		return return_data;
	}
