	function recreate_paper_id(record) {
		var valid_month_names = ["Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec"];
		var return_paper_id = "";
		var article_journal = (record["journal"] ? j_truncate(record["journal"], 24) : cleanup_article_link(record["paper_id"], true));
		if (record["epoch_time"]) {
			var pub_date = new Date(record["epoch_time"] * 1000);
			var pub_date_str = pub_date.toISOString().split('T')[0];
			var pub_date_str_array = pub_date_str.split("-");
			pub_date_str_array[1] = valid_month_names[parseInt(pub_date_str_array[1]) - 1];
			pub_date_str = pub_date_str_array.join("_");
			return_paper_id = article_journal + "_" + pub_date_str + "_xxxx";
		} else {
			if (record["paper_id_date"]) {
				return_paper_id = record["paper_id_date"];
			} else {
				return_paper_id = record["paper_id"];
			}
		}
		return return_paper_id;
	}
