	function remove_msd( value ) {
		if (value > 100000) {
			return Math.floor(value / 100000) * 100000;
		} else if (value > 10000) {
			return Math.floor(value / 10000) * 10000;
		} else if (value > 1000) {
			return Math.floor(value / 1000) * 1000;
		} else if (value > 100) {
			return Math.floor(value / 100) * 100;
		} else {
			return value;
		}
	}
	function odometer_effect_titles(title_id, num) {
		var odometer = document.querySelector(title_id);
		var od = new Odometer({
			el: odometer,
			value: remove_msd(num),
		});
		setTimeout(function(){
			od.update(num);
		}, 220);
	}
	function refresh_key(search_str, query, skip_event, filter_type) {
		var data = {};
		data.qx = _be_params.q;
		data.cx = _be_params.c;
		data.tx = "commercial";
		jQuery.ajax({
			type: "post",
			url: _config.be_form_url + "/get_token/",
			data: data,
			success: function (token) {
				_config.key = token;
				// _be_params.k = _config.key;
				self.stamp = new Date().getTime();
				self.back_end_active = false;
				request_widget_data_internal(search_str, query, skip_event, filter_type);
			},
			error: function (xhr, ajaxOptions, thrownError) {
			}
		});
	}
