	function process_rating_filter_click(name, index) {
		var filters_changed = false;
		var applied_rating_filters_array = [];
		if (self.applied_rating_filters.length > 0) {
			applied_rating_filters_array = self.applied_rating_filters.split(",");
		}
		if (applied_rating_filters_array.indexOf(name.toLowerCase().split(" ")[0]) == -1) {
			applied_rating_filters_array.push(name.toLowerCase().split(" ")[0]);
			filters_changed = true;
		}
		self.applied_rating_filters = applied_rating_filters_array.join();
		if (filters_changed) {
			if (self.current_page != 1) {
				self.current_page = 1;
			}
			request_widget_data_internal(self.search_str, self.query, true, 8);
		}
		return false;
	}
	function process_rating_tree_chart_data(rating_values) {
		var total_92 = 0;
		var total_94 = 0;
		var total_96 = 0;
		var total_98 = 0;
		var rating_data = [{name:"98/100", value: 0, color: "", index: 0},
			{name:"96/100", value: 0, color: "", index: 0},
			{name:"94/100", value: 0, color: "", index: 0},
			{name:"&lt;92/100", value: 0, color: "", index: 0}];

		for (var i = 0; i < rating_values.length; i++) {
			if (rating_values[i].to <= 92 ) {
				total_92 += rating_values[i].v;
			} else if (rating_values[i].to <= 94 ) {
				total_94 += rating_values[i].v;
			} else if (rating_values[i].to <= 96 ) {
				total_96 += rating_values[i].v;
			} else {
				total_98 += rating_values[i].v;
			}
		}
		var total_ratings = total_92 + total_94 + total_96 + total_98;
		total_92 = total_92 / total_ratings * 100.0;
		rating_data[3].name = rating_data[3].name + " " + total_92.toFixed(0) + "%";
		rating_data[3].value = (total_92 < 5 ? 0 : total_92);
		total_94 = total_94 / total_ratings * 100.0;
		rating_data[2].name = rating_data[2].name + " " + total_94.toFixed(0) + "%";
		rating_data[2].value = (total_94 < 5 ? 0 : total_94);
		total_96 = total_96 / total_ratings * 100.0;
		rating_data[1].name = rating_data[1].name + " " + total_96.toFixed(0) + "%";
		rating_data[1].value = (total_96 < 5 ? 0 : total_96);
		total_98 = total_98 / total_ratings * 100.0;
		rating_data[0].name = rating_data[0].name + " " + total_98.toFixed(0) + "%";
		rating_data[0].value = (total_98 < 5 ? 0 : total_98);
		rating_data = rating_data.sort(rating_compare);
		if (self.applied_rating_filters.length > 0) {
			if (self.applied_rating_filters.indexOf(rating_data[0].name.toLowerCase().split(" ")[0]) == -1) {
				rating_data[0].color = "rgba(204, 204, 204, 0.5)";
			} else {
				rating_data[0].color = hexToRgb(_config.vendor_partner_color, "0.8");
			}
			if (self.applied_rating_filters.indexOf(rating_data[1].name.toLowerCase().split(" ")[0]) == -1) {
				rating_data[1].color = "rgba(204, 204, 204, 0.5)";
			} else {
				rating_data[1].color = hexToRgb(_config.vendor_partner_color, "0.6");
			}
			if (self.applied_rating_filters.indexOf(rating_data[2].name.toLowerCase().split(" ")[0]) == -1) {
				rating_data[2].color = "rgba(204, 204, 204, 0.5)";
			} else {
				rating_data[2].color = hexToRgb(_config.vendor_partner_color, "0.4");
			}
			if (self.applied_rating_filters.indexOf(rating_data[3].name.toLowerCase().split(" ")[0]) == -1) {
				rating_data[2].color = "rgba(204, 204, 204, 0.5)";
			} else {
				rating_data[3].color = hexToRgb(_config.vendor_partner_color, "0.3");
			}
		} else {
			rating_data[0].color = hexToRgb(_config.vendor_partner_color, "0.8");
			rating_data[1].color = hexToRgb(_config.vendor_partner_color, "0.6");
			rating_data[2].color = hexToRgb(_config.vendor_partner_color, "0.4");
			rating_data[3].color = hexToRgb(_config.vendor_partner_color, "0.3");
		}
		rating_data[0].index = 0;
		rating_data[1].index = 1;
		rating_data[2].index = 2;
		rating_data[3].index = 3;
		return rating_data;
	}
	function rating_compare(a, b) {
		if (a.value > b.value) return -1;
		if (b.value > a.value) return 1;
		return 0;
	}
	function hexToRgb(hex, opacity) {
		hex = hex.replace('#', '');
		var bigint = parseInt(hex, 16);
		var r = (bigint >> 16) & 255;
		var g = (bigint >> 8) & 255;
		var b = bigint & 255;
		return "rgba(" + r + "," + g + "," + b + "," + opacity + ")";
	}
	function setSlider(time_frame) {
		if ((time_frame !== self.selectedRange) || (self.selectedRange == "Max")) {
			var oldDate = '';

			var curObjDate = _date_data[_date_data.length - 1];
			var currentDate = curObjDate.m + '.31.' + curObjDate.y;
			if (time_frame === '1m'){
				oldDate = addMonths(currentDate, -1);
			}
			if (time_frame === '3m'){
				oldDate = addMonths(currentDate, -3);
			}
			if (time_frame === '6m'){
				oldDate = addMonths(currentDate, -6);
			}
			if (time_frame === '1y'){
				oldDate = addMonths(currentDate, -12);
			}
			if (time_frame === '2y'){
				oldDate = addMonths(currentDate, -24);
			}
			if (time_frame === '5y'){
				oldDate = addMonths(currentDate, -60);
			}
			if (time_frame === '10y'){
				oldDate = addMonths(currentDate, -120);
			}
			if (time_frame === 'Max'){
				oldDate = addMonths(currentDate, -5000);
			}
			setChartButtons(time_frame);
			self.selectedRange = time_frame;

			//Get beginning index
			var index = 0;
			var categories = [];
			_date_data.map(function(date, i){
				let curDate = (date.m + '.31.' + date.y);
				if (!compareTime(oldDate.split("."), curDate.split("."))){
					index = i;
					date.e = false;
				} else {
					date.e = true;
				}
				categories.push(date.m + '/' + date.y);
			});
			if (_date_data.length > 0) {
				// now refresh the date chart
				var chart_color = hexToRgb(_config.vendor_partner_color, "0.5");
				update_date_filter("#date-filter", _date_data, chart_color);
				//old year, cur year parameters
				setSliderHandles(index, _date_data.length - 1, categories, false);
				var beg = categories[index];
				var end = categories[_date_data.length - 1];
				setDateRange(beg, end);
			}
		}
	}
	function setChartButtons(time_frame) {
		var old_range = self.selectedRange;
		self.selectedRange = time_frame;
		jQuery('#date-button-' + old_range).css("color", _config.vendor_partner_color);
		jQuery('#date-button-' + old_range).css("background-color", "");
		jQuery('#date-button-' + time_frame).css("color", "white");
		jQuery('#date-button-' + time_frame).css("background-color", _config.vendor_partner_color);
	}
	function setSliderHandles(oldInt, curInt, xData, reset_buttons) {
		xData.map(function(year, i){
			if (i >= oldInt && i <= curInt){
				_date_data[i].c = true;
			} else {
				_date_data[i].c = false;
			}
		});
		if (reset_buttons && ((oldInt > 0) || (curInt < xData.length - 1))) {
			jQuery('#date-button-' + self.selectedRange).css("color", _config.vendor_partner_color);
			jQuery('#date-button-' + self.selectedRange).css("background-color", "");
			// self.selectedRange = "";
		} else if (!reset_buttons) {
			jQuery('#date-button-' + self.selectedRange).css("color", "white");
			jQuery('#date-button-' + self.selectedRange).css("background-color", _config.vendor_partner_color);
			// self.selectedRange = "Max";
		}
		//Clean date label under slider
		var vals = xData ? xData : [];
		jQuery('label[id^="label-"]').remove();
		var elBeg = jQuery('<label id=' + 'label-' + oldInt + '>' + vals[oldInt] + '</label>').css('left', '0%');
		var elEnd = jQuery('<label id=' + 'label-' + curInt + '>' + vals[curInt] + '</label>').css('left', 100 + '%');
		jQuery("#slider-range").append(elBeg);
		jQuery("#slider-range").append(elEnd);
	}

	function addMonths(date, months) {
		date = date.split(".");
		var curDate = new Date(date[2], date[0], date[1]);
		curDate.setMonth(curDate.getMonth() + months);
		var oldDate = curDate.getMonth() + '.' + curDate.getDate() + '.' + curDate.getFullYear();
		return oldDate;
	}
	function compareTime(time1, time2) {
		return new Date(time1[2], time1[0], time1[1]) <= new Date(time2[2], time2[0], time2[1]); // true if time1 is later
	}
	function process_filter_dates(dates_array) {
		var date_filter_data = [];
		for (var i = 0; i < dates_array.length; i++) {
			var date_entry = {};
			date_entry["y"] = dates_array[i].y.toString();
			if (dates_array[i].month < 10) {
				date_entry.m = "0" + dates_array[i].month.toString();
			} else {
				date_entry["m"] = dates_array[i].month.toString();
			}
			date_entry["v"] = dates_array[i].v.toString();
			date_entry["e"] = true;
			date_entry["c"] = false;
			date_filter_data.push(date_entry);
		}
		return date_filter_data;
	}
