	function find_chart(id) {
		var charts = Highcharts.charts;
		var return_chart = null;
		charts.forEach(function(chart, index) {
			if (chart && chart.renderTo.id == id) {
				return_chart = chart;
			}
		});
		return return_chart;
	}
