	function setDateRange(from, to) {
		var fromArray = from.split("/");
		var fromStr = fromArray[1] + "-" + fromArray[0];
		var toArray = to.split("/");
		if (from == to) {
			toArray[0] = parseInt(toArray[0]) + 1;
		}
		var toStr = toArray[1] + "-" + toArray[0];
		if (self.selectedRange != "Max") {
			self.applied_date_filters = fromStr + "-01:" + toStr + "-01";
		} else {
			self.applied_date_filters = "";
		}
		attach_date_filter_indicator_events();
		request_widget_data_internal(self.search_str, self.query, true, 11);
	}
	function render_trend_chart(id, dates, chart_color) {
		var categories = [];
		var yValues = [];
		if (dates) {
			var half = Math.ceil(dates.length / 2);
			var secondHalf = dates.slice(-half)
			secondHalf.map(function (date, i) {
				categories.push(date.m + '/' + date.y);
				let obj = {};
				if (date.e) {
					obj = {
						y: parseInt(date.v),
						color: chart_color
					};
				}
				yValues.push(obj);
			});
		}
		Highcharts.chart('trend-chart', {
			chart: {
				type: 'column',
				backgroundColor: 'rgba(0,0,0,0)',
				margin: [0,0,0,0]
			},
			title: {
				text: ''
			},
			rangeSelector: {
				enabled: false,
				inputEnabled: false
			},
			exporting: {
				enabled: false
			},
			credits: {
				enabled: false
			},
			yAxis: {
				labels: {
					enabled: false
				},
				plotLines: [{
					value: 0,
					width: 1,
					color: 'silver'
				}],
				gridLineColor: 'transparent',
				title: {
					text: 'Number',
					style: {
						fontSize: '0px'
					}
				}
			},
			xAxis: {
				categories: categories,
				tickColor: chart_color,

				//x-xAxis
				labels: {
					enabled: false
				},
				minorTickLength: 0,
				tickLength: 0
			},
			plotOptions: {
				column: {
					pointPadding: 0.2,
					borderWidth: 0
				},
				series: {
					borderRadius: 3
				}
			},
			navigator: {
				enabled: false
			},
			tooltip: {
				enabled: false
			},
			scrollbar: {
				enabled: false
			},
			series: [{
				name: 'Number of Mentions',
				showInLegend: false,
				data: yValues,
				states: {hover: {enabled: false}}
			}]
		});
	}

