	function set_sort_desc(desc) {
		if (desc == "date") {
			return self.lang.i18l("date") + " (<i class='fa fa-arrow-down'></i>)";
		} else if (desc == "date_asc") {
				return self.lang.i18l("date") + " (<i class='fa fa-arrow-up'></i>)";
		} else if (desc == "images") {
			return self.lang.i18l("images");
		} else if (desc == "impact_factor") {
			return "IF (<i class='fa fa-arrow-down'></i>)";
		} else if (desc == "impact_factor_asc") {
			return "IF (<i class='fa fa-arrow-up'></i>)";
		} else if (desc == "patents") {
			return self.lang.i18l("patents");
		} else if (desc == "supplemental") {
			return self.lang.i18l("supplementary");
		} else if (desc == "clinical_trials") {
			return self.lang.i18l("clinical_trials");
		} else if (desc == "phd_thesis") {
			return self.lang.i18l("phd_theses");
		} else if (desc == "cited_by_count") {
			return self.lang.i18l("article_citations");
		} else {
			return self.lang.i18l("sort_by");
		}
	}
