	function hide_filter_item(idx, id) {
		jQuery(id).hide();
	}
	function show_filter_item(idx, id) {
		jQuery(id).show();
	}
	function remove_filter_item(idx, id) {
		jQuery(id).remove();
	}
	function get_item_index(item_name, filter_array) {
		for (var i = 0; i < filter_array.length; i++) {
			if (item_name == filter_array[i].name) {
				return i;
			}
		}
		return -1;
	}
	function toggle_filter_dropdown(enabled_filter_array) {
		for (var i = 0; i < _filter_array.length; i++) {
			hide_filter_item(i, "#technique-filter-item-" + i);
		}
		remove_filter_item(i, "#technique-filter-item");
		for (var i = 0;i < enabled_filter_array.length; i++) {
			var idx = get_item_index(enabled_filter_array[i].name, _filter_array);
			if (idx > -1) {
				show_filter_item(idx, "#technique-filter-item-" + idx);
			} else {
				var filter_obj = enabled_filter_array[i];
				_filter_array.push(filter_obj);
				// add filter to menu
				var filter_html = create_technique_filter_entry(filter_obj, _filter_array.length - 1);
				jQuery( "#bioz-w-tech-product-filter-entries" ).append( filter_html );
				attach_tech_products_filter_clicks();
			}
		}
		var filter_html = "<li id='technique-filter-item' style='height:28px'></li>";
		jQuery( "#bioz-w-tech-product-filter-entries" ).append( filter_html );
	}
