	function apply_technique_filter_search(filter) {
		for (var i = 0; i < _filter_array.length; i++) {
			var startsWith = false;
			if (filter.length > 0) {
				var entryArray = _filter_array[i].name.split(" ");
				entryArray.map(function (entry, i) {
					if (entry.toLowerCase().indexOf(filter.toLowerCase()) > -1) {
						startsWith = true;
					}
				});
			} else {
				startsWith = true;
			}
			if (!startsWith) {
				// try now with just a whole string ...
				var entry = _filter_array[i].name;
				if (entry.toLowerCase().indexOf(filter.toLowerCase()) > -1) {
					startsWith = true;
				}
			}
			if (!startsWith) {
				// try now with just a whole string ...
				var entry = _filter_array[i].short_name;
				if (entry.toLowerCase().indexOf(filter.toLowerCase()) > -1) {
					startsWith = true;
				}
			}
			if (!startsWith) {
				jQuery("#technique-filter-item-" + i).hide();
			} else {
				jQuery("#technique-filter-item-" + i).show();
			}
		}
	}
