	function attach_filter_patents() {
		jQuery('.bioz-w-show-patents').each(function () {
			jQuery(this).click(function (ev) {
				ev.preventDefault();
				ev.stopImmediatePropagation();
				// console.log(ev);
				if (ev.target.tagName != "LABEL") {
					var elem = ev.target.parentElement;
				} else {
					var elem = ev.target;
				}
				var target_id = elem.id;
				var input_id = "#" + target_id + "-input";
				// changed technique filter ...
				if (jQuery(input_id).prop('checked')){
					jQuery(input_id).prop('checked', false);
					self.show_patents = false;
				} else {
					jQuery(input_id).prop('checked', true);
					self.show_patents = true;
				}
				request_widget_data_internal(self.search_str, self.query, true, 0);
				return false;
			});
		});
	}
