	function process_bubble_filter_click(name, index) {
		var filters_changed = false;
		var target_id = "bioz-w-check-" + index;
		var input_id = "#" + target_id + "-input";
		var applied_filters_array = [];
		if (self.applied_filters.length > 0) {
			applied_filters_array = self.applied_filters.split(",");
		}
		// changed technique filter ...
		if (jQuery(input_id).prop('checked')){
			jQuery(input_id).prop('checked', false);
			if (applied_filters_array.indexOf(jQuery("#" + target_id).attr("data-tag")) > -1) {
				var entry_index = applied_filters_array.indexOf(jQuery("#" + target_id).attr("data-tag"));
				applied_filters_array.splice(entry_index, 1);
				filters_changed = true;
			}
		} else {
			jQuery(input_id).prop('checked', true);
			if (applied_filters_array.indexOf(jQuery("#" + target_id).attr("data-tag")) == -1) {
				var tech_name = jQuery("#" + target_id).attr("data-tag");
				applied_filters_array.push(tech_name);
				filters_changed = true;
				var desc = 'Filter Click';
				var descx = _config.vendor + ':' + desc;
				var filter_value = (self.mode != "tech" ? "Technique - " : "Product - ") + tech_name;
				badge_event("Badge Click", desc, _config.vendor, self.query, filter_value);
				// ga('send', 'event', 'Vendor Widget', descx, "Query: " + filter_value);
			}
		}
		self.applied_filters = applied_filters_array.join();
		if (filters_changed) {
			if (self.current_page != 1) {
				self.current_page = 1;
			}
			if (applied_filters_array.length > 0) {
				attach_prod_tech_filter_indicator_events(applied_filters_array);
			} else {
				jQuery('#bioz-w-tech-prod-filter-indicator').hide();
			}
			request_widget_data_internal(self.search_str, self.query, true, 1);
		}
		return false;
	}
