	function remove_author_from_selected(author) {
		var applied_authors_filters_array = [];
		if (self.applied_authors_filters.length > 0) {
			applied_authors_filters_array = self.applied_authors_filters.split(",");
		}
		if (applied_authors_filters_array.length > 0) {
			// previous entry exists from search
			var index = applied_authors_filters_array.indexOf(author);
			if (index !== -1) {
				applied_authors_filters_array.splice(index, 1);
				if (self.current_page != 1) {
					self.current_page = 1;
				}
				if (applied_authors_filters_array.length > 0) {
					attach_authors_filter_indicator_events(applied_authors_filters_array);
				} else {
					jQuery('#bioz-w-authors-filter-indicator').hide();
				}
				self.applied_authors_filters = applied_authors_filters_array.join();
				// uncheck author in filter ...
				for (var i = 0; i < _authors_filter_array.length; i++) {
					if (_authors_filter_array[i].name == author) {
						// uncheck that entry in the filter list
						jQuery('#bioz-w-authors-check-' + i + '-input').prop('checked', false);
					}
				}
				render_authors_selected();
				attach_selected_authors_tags_events();
				request_widget_data_internal(self.search_str, self.query, true, 6);
			}
		}
	}
