	function update_key() {
		var today = new Date() // today, key: 0rz00J9910byi230LZ02
		var date_str = today.toISOString().slice(0, 10);
		var hour_str = today.toISOString().slice(11, 13);
		var date_str_array = date_str.split("-");
		var sliced_auth_key = _config.key.slice(0, 3) + hour_str + _config.key.slice(5, 8) + date_str_array[2] + _config.key.slice(10, 13) +
			date_str_array[0].slice(2, 4) + _config.key.slice(15, 18) + date_str_array[1];
		return sliced_auth_key;
	}

