	function parseHtmlEntities(str) {
		str = str.replace(/\\x/g, " ");
		str = str.replace(/\& quot;/g, "&quote;");
		str = str.replace(/\& gt;/g, "&gt;");
		str = str.replace(/\& lt;/g, "&lt;");
		var inner_str = unencodeHtmlStrings(str);
		inner_str = inner_str.replace(/<\/?xref[^>]*>/g, "");
		return inner_str;
	}

	function unencodeHtmlStrings(str) {
		var el = document.createElement('div');
		return str.replace(/\&[#0-9a-z]+;/gi, function (enc) {
			el.innerHTML = enc;
			return el.innerText
		});
	}
	function json_url_decode(val) {
		var safe_value = val.replace(/___/g, '/');
		safe_value = val.replace(/\'/g, '');
		return safe_value;
	}
	function numberWithCommas(x) {
		return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
	}
	function generate_rating_graph(rating, title, selection, help, nagative_param) {
		if (rating > 100) {
			rating = 100;
		}
		return "<td class=\"rating-detail\" style=\"font-size:11px;" +
			"padding: 0;vertical-align:top;color:#666; white-space: nowrap; width: 50px\">" +
			title + "&nbsp;</td>" +
			"<td style=\"padding: 1px 0; width: 50px\"><div style=\"width:50px\" class=\"b-progress b-progress-sm \">" +
			"<div class=\"b-progress b-progress-bar-rating " +
			"progress-bar-" + selection + (nagative_param ? " negative" : "") + " \" role=\"progressbar\" aria-valuenow=\"" +
			rating + "\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: " +
			rating + "%;height:100%;\"></div></div></td>";
	}
	function generate_stars_tooltipster(slice, data, show_legend, flag, main_id) {
		var returnHtml = "";
		if (data != null && data.rating_info && JSON.stringify(data.rating_info) != '{}') {
			var rating = (data.rating_info.doc_frequency + 25.1).toFixed(2);
			//style=\"width: 154px;font-size:11px;background:white\">" +
			returnHtml += "<table id=\"tooltip-content-" + flag + "\" style=\"width: 154px;font-size:11px;background:white\">" +
				"<tr><td colspan=\"2\" style=\"white-space:nowrap\">" +
				"<b style='color:#666666'>" + self.lang.i18l("bioz_stars_product_rating") + "</b></td></tr>" +
				"<tr><td colspan=\"2\" style='color:#666666;line-height:1.2;padding-top:3px;padding-bottom:3px'>" + self.lang.i18l("bioz_stars_description") + "</td></tr><tr>" +
				generate_rating_graph(rating, self.lang.i18l("mentions"), "default",
					"Mentions (Number of Mentions) - measured against the entire corpus of articles analysed.", false);
			returnHtml += "</tr><tr>";
			rating = data.rating_info.time_line_boost;
			if (rating >= 2.0) {
				rating = 100.0;
				returnHtml += generate_rating_graph(rating, "Recency", "default",
					"Recency (Paper Recency) - how recent is this paper from which this result came from.", false);
			} else {
				rating = (data.rating_info.time_line_boost * 50.0).toFixed(2);
				returnHtml += generate_rating_graph(rating, self.lang.i18l("recency"), "default",
					"Recency (Paper Recency) - how recent is this paper from which this result came from.", false);
			}
			returnHtml += "</tr>";
			if (flag == "m") {
				returnHtml += "<tr><td colspan=\"2\"><a style=\"color:" + _config.vendor_partner_color + ";text-decoration: none;cursor:pointer\" href=\"#wobj-" + _config.company + "-" + main_id + "\">" + self.lang.i18l("view_product_citations") + " &gt;</a></td></tr><tr>";
			} else if (flag == "s" && data["product_url"]) {
				returnHtml += "<tr><td colspan=\"2\"><a style=\"color:" + _config.vendor_partner_color + ";text-decoration: none;cursor:pointer\" href=\"" + data["product_url"] + "\">" + self.lang.i18l("view_product_page") + " &gt;</a></td></tr><tr>";
			}
			returnHtml += "<tr><td colspan=\"2\" style=\"padding:4px; margin:4px;text-align:center;border-top:1px solid #eee\">" +
				"<a id=\"bioz-w-rating-info\" style=\"color:" + _config.vendor_partner_color + ";text-decoration:none;cursor:pointer\" href=\"https://www.bioz.com/bioz_stars\" target=\"_blank\">" +
				self.lang.i18l("learn_more") + " -&gt;" +
				"</a></td></tr>";
			returnHtml += "</table>";
		} else {
			var rating = (slice * 20).toFixed(2);
			returnHtml += "<table style=\"border-collapse: collapse; padding: 0; width: 140px; height: 50px\">" +
				generate_rating_graph(rating, "Mentions:", "info", "", show_legend, false);
			returnHtml += generate_rating_graph(rating, "Recency:", "default", "", false);
			returnHtml += "<tr><td colspan=\"2\" style=\"padding:4px; margin:4px;text-align:center;border-top:1px solid #eee\">" +
				"<a id=\"bioz-w-rating-info\" style=\"color:" + _config.vendor_partner_color + ";text-decoration:none;cursor:pointer\" href=\"https://www.bioz.com/bioz_stars\" target=\"_blank\">" +
				self.lang.i18l("learn_more") + " -&gt;" +
				"</a></td></tr>";
			returnHtml += "</table>";
		}
		return returnHtml;
	}
